Een jonge Peruaanse beer, die een passie heeft voor alles wat Brits is, 
vertrekt naar Londen waar hij op zoek gaat naar een woning. 
Wanneer hij eenzaam en verloren op Paddington Station belandt 
begint hij te beseffen dat het leven in de stad niet is wat hij zich er 
van had voorgesteld. Maar dan ontmoet hij de vriendelijke familie
Brown, die het label om zijn nek lezen ('Pas alsjeblieft op deze beer, 
dankjewel') en hem een tijdelijk onderkomen aanbieden.
