A young Peruvian bear with a passion for all things British travels 
to London in search of a home. Finding himself lost and alone at 
Paddington Station, he begins to realize that city life is not all he 
had imagined - until he meets the kindly Brown family, who read 
the label around his neck ('Please look after this bear. Thank you.') 
and offer him a temporary haven. It looks as though his luck has 
changed until this rarest of bears catches the eye of a museum taxidermist.

